import pytestfrom databases.google_table_ranges import wacom_table_url, xp_pen_table_url, XP_PEN_RANGES, WACOM_RANGESfrom databases.parse_db import GoogleSheetfrom tests.test_data import WRONG_WACOM_RANGES, WRONG_XP_PEN_RANGESclass TestGenerateFromGoogleSheet:    @pytest.mark.parametrize("url, ranges, expected_data", [        (wacom_table_url, WACOM_RANGES, 3),        (xp_pen_table_url, XP_PEN_RANGES, 3),        (wacom_table_url, WRONG_WACOM_RANGES, 3),        (xp_pen_table_url, WRONG_XP_PEN_RANGES, 3)    ])    def test_parse_generate_info_from_google_sheet_lenght(url, ranges, expected_data):        table = GoogleSheet()        data = table.generate_info_from_google_sheet(google_sheet_url=url, ranges=ranges)        for item in data:            assert len(item) == expected_data    @pytest.mark.parametrize("url, ranges, expected_data", [        (wacom_table_url, WACOM_RANGES, dict),        (xp_pen_table_url, XP_PEN_RANGES, dict),        (wacom_table_url, WRONG_WACOM_RANGES, dict),        (xp_pen_table_url, WRONG_XP_PEN_RANGES, dict)    ])    def test_parse_generate_info_from_google_sheet_type(url, ranges, expected_data):        table = GoogleSheet()        data = table.generate_info_from_google_sheet(google_sheet_url=url, ranges=ranges)        for item in data:            assert type(item) == expected_data    def test_shops_returned_data(self, start_shop_func, data):        pass